import { Provider } from 'react-redux';
import store from '../ck/redux/store';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import src1 from './src/src1';
import src2 from './src/src2';
import { NavigationContainer } from '@react-navigation/native';

const App = () => {
  const stack = createNativeStackNavigator();
  return (
    <NavigationContainer>
      <stack.Navigator initialRouteName='src1' screenOptions={{ headerShown: false }}>
        <Provider store={store}>
          <stack.Screen name='src1' component={src1} />
          {/* <stack.Screen name='src2' component={src2} /> */}
        </Provider>
      </stack.Navigator>
    </NavigationContainer>
    // <Provider store={store}>
    //   <Src1 />
    //   <Src2 />
    // </Provider>
  )

}


export default App;
